import React, { useState } from "react";
import './Styles.css';


const Red = () => {
	const [sec, setSec] = useState(10)
	
	return (
		<>
		<div className="trafic">
			<div className="lighter red active">{sec}</div>
			<div className="lighter yellow"></div>
			<div className="lighter green"></div>
		</div>	
		</>
	)
}

export default Red
